import React,{ Component } from 'react';
import Logged from './components/Model';
import axios from "axios"

export default class Home extends Component {


  componentDidMount(){
    this.props.getData()
  }
  render() {
    const info=this.props.state.title.map((item,index)=>{
      return <Logged url={this.props.t.url[index]} title={this.props.that.title[index]} train_score={this.props.that.train_score[index]} test_score={this.props.that.test_score[index]} key={index} id={this.props.that.id[index]} />
    })
    return (
      <div>
        {info}
        <div className='col-12 col-sm-6 col-md-4 card_model'>
        <div className="card border-success mb-5">
        <h4 className="card-header text-center">Add New</h4>
        </div>
        </div>
      </div>
    )
  }
}
